import { createAsyncThunk } from "@reduxjs/toolkit";
import { getLog } from "./userService";
export const fetchUser = createAsyncThunk("user/fetchUser", async () => {
  try {
    const resultado = await getLog();
    return resultado;
  } catch (error) {}
});
